import React from "react";
import PropTypes from "prop-types";

function MerchDetail(props) {
  // Add in onClickingDelete once that's ready
  const { merch } = props;

  return (
    <React.Fragment>
      <h1>Merch Detail</h1>
      <h3>{merch.item} - {merch.price}</h3>
      <p>{merch.color}</p>
      <p>{merch.size}</p>
      <p>{merch.quantity}</p>
      <hr/>
      </React.Fragment>
  );
}

